import React from "react";
import PageLayout from "src/Layouts/PageLayout";

const Work = () => {
  return (
    <PageLayout>
      <main className="flex flex-col flex-grow gap-20 px-32 mx-10 mb-10 border-x-2 border-black overflow-auto">
        <h4 className="grid py-20 text-8xl tracking-wider font-medium border-b border-black">
          <span>KAIXIN</span> HUANG
        </h4>

        <section className="flex flex-col flex-grow gap-5">
          <span className="uppercase text-sm font-medium">WHO AM I</span>
          <article className="grid">
            <img src="/about-me/who-am-i.png" alt="who am i" />
            <caption className="justify-self-end uppercase text-xs">
              Chapultepec Castle, Mexico City
            </caption>
          </article>
        </section>
      </main>
    </PageLayout>
  );
};

export default Work;
